import Vue from 'vue'
import Vuex from 'vuex'

Vue.use(Vuex)

export default new Vuex.Store({
  state: {
    title: "My custom Title",
    links: [
      "http://google.com",
      "http://youtube.com",
      "http://harshittpandey.github.io"
    ]
  },
  getter: {
    countLinks: state=> {
      return state.links.length
    }
  },
  mutations: {

  },
  actions: {

  }
})
